import React, { Component } from 'react';
import Login from './Login';
import SignUp from './SignUp'


class SignUpLogin extends Component {

    constructor(props) {
        super(props);
         this.state = {
            login :"",
            signup :""
        }
        this.switch = this.switch.bind(this);
        this.getInitialState = this.getInitialState.bind(this);

    }
    getInitialState() {
        return this.setState({ login: true, signup: false })
    }

    switch(word) {
        var login1 ,signup1
        if (word === "signup") { signup1 = true; login1 = false; }
        else { login1 = true; signup1 = false; }
        return this.setState({ login: login1, signup: signup1 })
    }
    render() {
           return (
            <section id="three" class="wrapper">
            <div class="inner">
                <div id="buttons">
                    <p id="signupButton" onClick={(event) => this.props.history.push(`/signup`)} className={this.state.signup ? 'yellow' : "blue"}>Sign In</p>
                    <p id="loginButton" onClick={this.switch.bind(null, "login")} className={this.state.login ? "yellow" : "blue"}> Login</p>
                </div>
                {this.state.signup ? <SignUp /> : null}
                {this.state.login ? <Login /> : null}
            </div>
            </section>

        )


    }
}


export default SignUpLogin;
